import React from 'react';
import ReactDOM from 'react-dom';

function Nav () {
    return (
        <header class="navbar">
            <a href="/">placeholder a</a>
            <a id="nav-icon" href="/">Decoco</a>
            <a href="/">placeholder c</a>
        </header>
    );
}

function Footer () {
    return (
        <footer class="footer">
            <a href="/">placeholder a</a>
            <a href="/">placeholder b</a>
            <a href="/">placeholder c</a>
        </footer>
    );
}

function Main () {
    return (
        <main class="content">
            <h1>custom made designs</h1>
            <div class="image-gallery">
                <img src="images/nadia.jpg"/>
            </div>
            <div class="custom-design">
                <p>We do custom made designs</p>
            </div>
        </main>
    )
}

 function App () {
    return (
        <div>
            <Nav />
            <Main />
            <Footer />
        </div>
    );
}

ReactDOM.render (
    <App />,
    document.getElementById('root')
)
